import './App.css';
import {useState} from "react";

function App() {
    const [listOfPackages, setListOfPackages] = useState([]);
  return (
    <div className="App">
      <div className="packagesDisplay">
          {listOfPackages.map((package_data) => {
              return <div>
                  <h1>Item ID: package_data.item_id</h1>
              </div>
          })}
      </div>
    </div>
  );
}

export default App;
